// HiddenLayer = 784 i cells * 2 * 4 bytes * 8 o cells = +- 50Kbytes
// OutputLayer = 8 i cells * 2 * 4 bytes * 10 o cells = +- 640bytes
// image_vector  = 784 i cells  * 10 o cells * 4 bytes = +- 31Kbytes
// weight_vector_hidden_layer = 784 i cells  * 8 o cells * 4 bytes = +- 25Kbytes
// weight_vector_output_layer = 8 i cells  * 10 o cells * 4 bytes = +- 320bytes
// bias_vector_hidden_layer = 8 i cells * 4 bytes = +- 32bytes
// bias_vector_output_layer = 10 i cells * 4 bytes = +- 40bytes
// estimated stack size: 50Kbytes + 640bytes + 31Kbytes + 25Kbytes + 320bytes + 32bytes + 40bytes ~= 100Kbytes

typedef struct HiddenCell HiddenCell;
typedef struct OutputCell OutputCell;

typedef struct HiddenLayer HiddenLayer;
typedef struct OutputLayer OutputLayer;

struct HiddenCell {
    int input [NUMBER_OF_INPUT_CELLS];
    int weight[NUMBER_OF_INPUT_CELLS];
    int output;
    int bias;
};

struct OutputCell {
    int input [NUMBER_OF_HIDDEN_CELLS];
    int weight[NUMBER_OF_HIDDEN_CELLS];
    int output;
    int bias;
};

struct HiddenLayer {
    HiddenCell cell[NUMBER_OF_HIDDEN_CELLS];
};

struct OutputLayer {
    OutputCell cell[NUMBER_OF_OUTPUT_CELLS];
};

void setInputLayer (HiddenLayer * l, int image[]) {
	int i,j;
	
	for (i = 0; i < NUMBER_OF_HIDDEN_CELLS; i++) {
		for (j = 0; j < NUMBER_OF_INPUT_CELLS; j++) {
			l->cell[i].input[j] = image[j];
		}
	}
}

void setOutputLayer (OutputLayer * ol, HiddenLayer * hl) {
	int i,j;
	
	for (i = 0; i < NUMBER_OF_OUTPUT_CELLS; i++) {
		for (j = 0; j < NUMBER_OF_HIDDEN_CELLS; j++) {
			ol->cell[i].input[j] = hl->cell[j].output;
		}
	}
}

void setHiddenCellWeight (HiddenCell * c, int weight[]) {
	int i;
	
	for (i = 0; i < NUMBER_OF_INPUT_CELLS; i++) {
		c->weight[i] = weight[i];
	}
}

void setOutputCellWeight (OutputCell * c, int weight[]) {
	int i;
	
	for (i = 0; i < NUMBER_OF_HIDDEN_CELLS; i++) {
		c->weight[i] = weight[i];
	}
}

void setHiddenCellBias (HiddenCell * c, int bias) {
	c->bias = bias;
}

void setOutputCellBias (OutputCell * c, int bias) {
	c->bias = bias;
}

void setHiddenCellOutput (HiddenLayer * l) {
	int i,j;
		
	for (i = 0; i < NUMBER_OF_HIDDEN_CELLS; i++) {
		l->cell[i].output = l->cell[i].bias;
		for (j = 0; j < NUMBER_OF_INPUT_CELLS; j++) {
			l->cell[i].output = l->cell[i].output + ((l->cell[i].input[j] * l->cell[i].weight[j]) - (l->cell[i].weight[j]*-128));
		}
	}	
}

void setOutputCellOutput (OutputLayer * l) {
	int i,j;
		
	for (i = 0; i < NUMBER_OF_OUTPUT_CELLS; i++) {
		l->cell[i].output = l->cell[i].bias;
		for (j = 0; j < NUMBER_OF_HIDDEN_CELLS; j++) {
			l->cell[i].output = l->cell[i].output + ((l->cell[i].input[j] * l->cell[i].weight[j]) - (l->cell[i].weight[j]*-128));
		}
	}
}

